import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import youtuber from './App';

ReactDOM.render(
  <React.StrictMode>
    <ol>
      <li>Kali Prasad</li>
      <li>{youtuber}</li>
    </ol>
  </React.StrictMode>,
  document.getElementById('root')
);
